import React, { Component } from 'react'
import { Segment } from 'semantic-ui-react';

class Login extends Component{
    render() {
        return (
            <Segment textAlign='center' vertical className='login-container'>
                <Headers as='h1'>
                    Login
                </Headers>
            </Segment>
        );
    }
}

export default Login;
